Wypróbuj mega smaczną sałatkę. Potrzebujesz: 4-5 ziemniaków sałatkowych ugotowanych, ugotowany brokuł, ok. 300 g pomidorków koktajlowych, 3-4 kiszone ogórki, ok.150 g sera sałatkowego typu feta, 1 cebulę. Do sosu potrzebujesz: 3-4 łyżki jogurtu naturalnego, 1 łyżkę majonezu, 1 łyżeczkę musztardy, 1-2 łyżeczki miodu lub cukru, sól do smaku.
